function getHardwareItemDeviceName(identifier) {
  switch (identifier) {
    case 'controlAsREVModule':
      return 'control';
    case 'controlAsServoController':
      return 'control';
    case 'controlAsVoltageSensor':
      return 'control';
    case 'imuAsIMU':
      return 'imu';
    case 'leftmotor0AsDcMotor':
      return 'leftmotor0';
    case 'rightmotor1AsDcMotor':
      return 'rightmotor1';
    case 'topleftmotor2AsDcMotor':
      return 'topleftmotor2';
    case 'toprightmotor3AsDcMotor':
      return 'toprightmotor3';
  }
  throw 'Unexpected identifier (' + identifier + ').';
}

